import React from 'react'
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

export default function BuffetService() {
    return (
        <Card style={{ width: '22rem' }}>
          <Card.Body style={{backgroundColor:'lightcoral'}}>
            <Card.Title style={{textAlign:'center'}}><h1>Buffet Service</h1></Card.Title>
            <Card.Text style={{marginLeft:25}}>
            <Card.Img variant="top" src="https://4.imimg.com/data4/HS/VH/MY-15238607/buffet-services.jpg" height={300} width={300}/>
          
              <h2>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Buffet restaurants offer a self-service dining experience, 
            where customers serve themselves from a variety of dishes displayed on a table or counter. Prices 
            are often based on a flat fee, not per dish, and customers can usually return for additional servings.</h2>
            </Card.Text>
            {/* <Button variant="primary">Go somewhere</Button> */}
          </Card.Body>
        </Card>
      );
}
